import React from "react";

export const DropDownProducts = () => {
  return (
    <div>
      <ul>
        <li>Lopeti</li>
        <li>Topoare</li>
        <li>Gazon</li>
        <li>Copacei</li>
      </ul>
    </div>
  );
};
